import React from 'react';
import {
    div,
    divLink,
    Bars,
    divMenu,
} from './HeaderBar'
import Typography from '@mui/material/Typography';

function Header() {
    return (
        <>
            <div>
                <divLink to='/'>
                    <Typography variant='h6'>
                        VOICE TO HAND
                    </Typography>
                </divLink>
                <Bars />
                <divMenu>
                    <divLink to='/about' activeStyle>
                        How to use
                    </divLink>
                    <divLink to='/learn' activeStyle>
                        Learning
                    </divLink>
                </divMenu>
            </div>
        </>
    );
}

export default Header;
